import React from "react";
import "./css-components/slide-show.css";
import { Button } from "reactstrap";

function SlideShow() {
  return (
    <div className="slider">
      <div className="slides">
        <div id="slide-1">
          <h1>Help out someone and get Paid</h1>

          <span>
            Signup to be a Helper and join the large network of helpers
          </span>
        </div>

        <div id="slide-2">2</div>
      </div>

      <a className="slide-but-1" href="#slide-1">
        <button className="slide-but-1" color=""></button>
      </a>
      <a className="slide-but-1" href="#slide-2">
        <button className="slide-but-2" color="info"></button>
      </a>
    </div>
  );
}

export default SlideShow;
